import React, { useState } from 'react';
import Recipes from './recipes';

const App = () => {
	const [apiData, setApiData] = useState(null);

	const handleDataFromChild = (data) => {
		setApiData(data)
	}

	return (
		<div>
			<Recipes endpoint={'recipes'} query={'Biryani'} type={'image'} onDataFetched={handleDataFromChild} />
			{apiData.map(item => item)}
		</div>
	);
};

export default App;
